import React, { Component } from "react";
import banana from "../assets/banana.jpg";

class Home extends Component {
  render() {
    return (
      <div id="homeSection">
        <div id="welcome">
          <div id="welcomeMessage">
            <h2>Hi, I'm Charlie...</h2>
            <p>HIRE ME PLEASE I'M DEPSERATE OMG</p>
          </div>
          <div id="welcomeButtons">
            <a href="#" id="cvButton">
              My CV
            </a>
            <a href="#" id="contactButton">
              Contact Me
            </a>
          </div>
        </div>

        <div id="profile">
          <div id="homeImage">
            <img src={banana} alt="Photo of Charlie" />
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
